import React from 'react';
import './Contetn2.css'; // Подключаем стили модуля
import icon from '../img/icon.png'; // Подключаем иконку, путь измените на актуальный

const Contetn2 = () => {
  // Данные для прямоугольников
  const items = [
    { id: 1, name: 'Название 1', quantity: 'Количество 1' },
    { id: 2, name: 'Название 2', quantity: 'Количество 2' },
    { id: 3, name: 'Название 3', quantity: 'Количество 3' },
    { id: 4, name: 'Название 4', quantity: 'Количество 4' },
    { id: 5, name: 'Название 5', quantity: 'Количество 5' },
    { id: 6, name: 'Название 6', quantity: 'Количество 6' },
    { id: 7, name: 'Название 7', quantity: 'Количество 7' },
    { id: 8, name: 'Название 8', quantity: 'Количество 8' },
    { id: 9, name: 'Название 9', quantity: 'Количество 9' },
    { id: 10, name: 'Название 10', quantity: 'Количество 10' },
    { id: 11, name: 'Название 11', quantity: 'Количество 11' },
    { id: 12, name: 'Название 12', quantity: 'Количество 12' }
  ];

  return (
    <div className="grid-container">
      {items.map(item => (
        <div key={item.id} className="grid-item">
          <img src={icon} alt="Иконка" className="item-icon" />
          <div className="item-text">
            <div className="item-name">{item.name}</div>
            <div className="item-quantity">{item.quantity}</div>
          </div>
        </div>
      ))}
    </div>
  );
};

export default Contetn2;
